import React, { Component } from 'react';
import axios from 'axios';

import './App.css';

import SearchBar from './components/SearchBar';

class App extends Component {
  onSubmitHandler = e => {
    e.prevent.default();
    console.log('form submitted');
  };
  render() {
    return (
      <div className="App">
        <SearchBar onSubmitHandler={this.onSubmitHandler} />
      </div>
    );
  }
}

export default App;
